INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (10,'8','2','حقوق الملكية الفكرية',1,0,0,'<b>حقوق الملكية الفكرية</b>\\nفي إطار حملة نوعية فيما يخص حقوق الملكية الفكرية، بين يديك هنا مجموعة من الوثائق حول هذا الموضوع من مديرية حماية الملكية الصناعية والتجارية في وزارة التجارة الداخلية.\\n<a href=\"https://hiast.edu.sy/sites/default/files/general/%D9%83%D9%84%20%D9%85%D8%A7%D8%AA%D8%AD%D8%AA%D8%A7%D8%AC%20%D9%85%D8%B9%D8%B1%D9%81%D8%AA%D9%87%20%D9%82%D8%A8%D9%84%20%D8%A3%D9%86%20%D8%AA%D8%A8%D8%AF%D8%A3.pdf\">كل ماتحتاج معرفته قبل أن تبدأ</a>\\n<a href=\"https://hiast.edu.sy/sites/default/files/general/%D8%A8%D8%B1%D9%86%D8%A7%D9%85%D8%AC%20%D8%A7%D9%83%D8%A7%D8%AF%D9%8A%D9%85%D9%8A%D8%A9%20%D8%A7%D9%84%D9%88%D8%A7%D9%8A%D8%A8%D9%88%20%D8%A7%D9%84%D8%AA%D8%AF%D8%B1%D9%8A%D8%A8%D9%8A%20%D9%84%D8%B9%D8%A7%D9%85%202013.pdf\">برنامج اكاديمية الوايبو التدريبي لعام 2013</a>\\n<a href=\"https://hiast.edu.sy/sites/default/files/general/%D9%85%D8%B9%D8%B1%D8%B6%20%D9%85%D8%A7%D9%84%D9%8A%D8%B2%D9%8A%D8%A7%20%D8%A7%D9%84%D8%AF%D9%88%D9%84%D9%8A%20%D9%84%D9%84%D8%A7%D8%AE%D8%AA%D8%B1%D8%A7%D8%B9.pdf\">معرض ماليزيا الدولي للاختراع</a>\\n<a href=\"https://hiast.edu.sy/sites/default/files/general/%D8%AF%D9%84%D9%8A%D9%84%20%D8%A7%D9%84%D9%85%D8%AE%D8%AA%D8%B1%D8%B9.pdf\">دليل المخترع</a>\\n<a href=\"https://hiast.edu.sy/sites/default/files/general/%D8%A7%D9%84%D8%A8%D8%AD%D8%AB%20%D9%81%D9%8A%20%D8%A7%D9%84%D8%AD%D8%A7%D9%84%D8%A9%20%D8%A7%D9%84%D8%AA%D9%82%D9%86%D9%8A%D8%A9%20%D8%A7%D9%84%D8%B5%D9%86%D8%A7%D8%B9%D9%8A%D8%A9.pdf\">البحث في الحالة التقنية الصناعية</a>\\n<a href=\"https://hiast.edu.sy/sites/default/files/general/%D8%A7%D9%84%D9%82%D8%A7%D9%86%D9%88%D9%86%20%D8%B1%D9%82%D9%85%2018%D8%A7%D9%84%D9%85%D8%AA%D8%B9%D9%84%D9%82%20%D8%A8%D9%85%D9%86%D8%AD%20%D8%A8%D8%B1%D8%A7%D8%A1%D8%A7%D8%AA%20%D8%A7%D9%84%D8%A7%D8%AE%D8%AA%D8%B1%D8%A7%D8%B9%20%D9%84%D9%84%D8%B9%D8%A7%D9%85%202012%20%28%D8%B9%D8%B1%D8%A8%D9%8A%29.pdf\">القانون رقم 18المتعلق بمنح براءات الاختراع للعام 2012 (عربي)</a>\\n<a href=\"https://hiast.edu.sy/sites/default/files/general/%D8%A7%D9%84%D9%82%D8%A7%D9%86%D9%88%D9%86%20%D8%B1%D9%82%D9%85%2018%D8%A7%D9%84%D9%85%D8%AA%D8%B9%D9%84%D9%82%20%D8%A8%D9%85%D9%86%D8%AD%20%D8%A8%D8%B1%D8%A7%D8%A1%D8%A7%D8%AA%20%D8%A7%D9%84%D8%A7%D8%AE%D8%AA%D8%B1%D8%A7%D8%B9%20%D9%84%D9%84%D8%B9%D8%A7%D9%85%202012%20%28%D8%A5%D9%86%D9%83%D9%84%D9%8A%D8%B2%D9%8A%29.pdf\">القانون رقم 18المتعلق بمنح براءات الاختراع للعام 2012 (إنكليزي)</a>\\n<a href=\"https://hiast.edu.sy/sites/default/files/general/%D8%A7%D9%84%D8%A3%D9%88%D8%B1%D8%A7%D9%82%20%D8%A7%D9%84%D9%85%D8%B7%D9%84%D9%88%D8%A8%D8%A9%20%D9%84%D8%AA%D8%B3%D8%AC%D9%8A%D9%84%20%D8%A8%D8%B1%D8%A7%D8%A1%D8%A9%20%D9%86%D9%85%D9%88%D8%B0%D8%AC%20%D9%85%D9%86%D9%81%D8%B9%D8%A9.pdf\">الأوراق المطلوبة لتسجيل براءة نموذج منفعة</a>',NULL,NULL);
