INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (14,'12','5','برامج الماجستير',1,0,0,'<b>برامج الماجستير</b>\\nتتوفر في المعهد العالي حالياً برامج الماجستير التالية :\\n<a href=\"https://www.hiast.edu.sy/ar/communication-systems-master\">نظم الاتصالات.</a>\\n<a href=\"https://www.hiast.edu.sy/ar/control-and-robotics-master\">التحكم والروبوتيك.</a>\\n<a href=\"https://www.hiast.edu.sy/ar/dss-master\">نظم المعلومات ودعم القرار.</a>\\n<a href=\"https://www.hiast.edu.sy/ar/big-data-master\">نظم المعطيات الكبيرة.</a>\\n<a href=\"https://www.hiast.edu.sy/ar/materials-science-master\">علوم وهندسة المواد.</a>\\n<a href=\"https://www.hiast.edu.sy/ar/optical-science-master\">نظعلوم وهندسة البصريات</a>\\n<b>أهداف الماجستير</b>\\nيهدف تحضير الماجستير إلى استكمال المعارف في إحدى المجالات العلميّة التخصصية والتعمّق بها، واكتساب بعض الخبرات في أساليب البحث العلمي وطرائقه.\\n <b>تنظيم أوقات الدراسة وأسس الخطّة الدرسيّة</b>\\n يشرف على كلّ ماجستير لجنة برئاسة وكيل المعهد للشؤون العلميّة والبحث العلمي وعضويّة أحد أعضاء هيئة البحث العلمي في المعهد، ويكون مشرفاً على الماجستير ومتابعة الدراسة فيه، إضافةً إلى عضويّة رئيس القسم أو المخبر الذي يقع اختصاص الماجستير ضمن نطاق اهتمامه.\\nيشترط لتحضير شهادة الماجستير أن يكون الطالب حاصلاً على الإجازة في الاختصاص - الذي تنضوي تحته دراسة الماجستير - بتقديرٍ جيّد على الأقل، أو أن يكون حاصلاً على شهادة أعلى من الإجازة وذات صلة باختصاص الماجستير.\\nلا تقلّ مدّة الدراسة في الماجستير عمّا هو مقرّر لها في جامعات القطر العربي السوري.\\nيتضمّن منهاج الدراسة عدداً من المقرّرات النظريّة إضافةً إلى مشروع بحث ينجزه الطالب في مدّة لا تقلّ عن 120 يوم عمل فعلي.\\nيدرّس في الماجستير مقرّرٌ واحدٌ على الأقلّ باللغة الأجنبيّة.\\nيمكن أن يساهم في تدريس بعض المقررات مدرسون من ذوي الخبرة العالية من جامعات عربية أو أجنبيّة.\\n <a href=\"https://hiast.edu.sy/ar/master\">للمزيد...</a>',NULL,NULL);
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (15,'13','5','برامج الدكتوراه',1,0,0,'<b>برامج الدكتوراه</b>\\nأسس المعهد العالي للعلوم التطبيقية والتكنولوجيا ليكون مركز تميز يواكب الجامعات العالمية في تأهيل أطر قادرة على إجراء بحوث هندسية وتطبيقية. أحدثت شهادة الدكتوراه في المعهد العالي ليكون الحاصل على الشهادة مؤهلاً للعمل الأكاديمي للتدريس في الجامعات ولإجراء بحوث علمية وتطبيقية مميزة .لتحقيق هذا الهدف لابد أن يحقق الطالب الذي سيسجل على الدكتوراه عدداً من الشروط النوعية وأن تلبي خطة البحث التي سيعمل عليها معايير محددة.\\nمدّة تحضير الدكتوراه ثلاث سنوات يمكن تمديدها سنة إضافيّة بقرار من مجلس المعهد.\\n <b> تتوفر  في المعهد العالي حالياً برامج الدكتوراه التالية :</b>\\n <a href=\"https://hiast.edu.sy/ar/communication-systems-doctorate\">الاتصالات.</a>\\n <a href=\"https://hiast.edu.sy/ar/Informatics-Ph.D.\">المعلوماتية.</a>\\n <a href=\"https://hiast.edu.sy/ar/control-and-robotics-doctorate\">نظم التحكم.</a> \\n <a href=\"https://hiast.edu.sy/ar/applied_physics\">الفيزياء التطبيقية.</a>\\n<a href=\"https://hiast.edu.sy/ar/doctorate\">للمزيد...</a>',NULL,NULL);
