INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (173,'10020','10019','هل المعهد العالي خاص أم حكومي؟',0,0,0,'المعهد العالي للعلوم التطبيقية والتكنولوجيا -HIAST- مؤسسة حكومية غير ربحية رديفة لجامعات القطر، وشهاداته في الهندسة والماجستير والدكتوراه مقرة من مجلس التعليم العالي ومعترف بها محلياً ودولياً، وهو ليس معهداً متوسطاً فمدة الدراسة فيه في الهندسة هي خمس سنوات. إضافةً إلى الطلاب الموفدين داخلياً لصالح جهات مختلفة أثناء دراستهم، يقبل المعهد العالي طلاب دراسة خاصة يتحملون رسوم دراستهم ولا تترتب عليهم أية التزامات بعد التخرج.','2021-09-02 06:57:49','2021-09-02 06:57:49');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (174,'10021','10019','ما هي اختصاصات الهندسة المتاحة في المعهد العالي؟',0,0,0,'يتيح المعهد العالي حالياً الاختصاصات التالية في دمشق: الاتصالات، النظم الإلكترونية، الميكاترونيكس، علوم وهندسة المواد، النظم المعلوماتية-هندسة البرمجيات، النظم المعلوماتية-الشبكات ونظم التشغيل. كما يتوفر حالياً في فرع المعهد العالي في حلب اختصاص هندسة الطيران فقط. مدة الدراسة في كل اختصاص هندسي هي خمس سنوات. قد تحدث اختصاصات جديدة بحسب الحاجة.','2021-09-02 06:58:14','2021-09-02 06:58:29');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (175,'10022','10019','ما شروط التسجيل والقبول للدراسة في المعهد العالي؟',0,0,0,'أولاً : حملة الثانوية العامة السورية:\r\nأن يكون الطالب من بين الـ ( 15% ) الأوائل على القطر في الترتيب العام للناجحين في الثانوية العامة –الفرع العلمي في العام الدراسي الحالي ويحقق هذا الشرط من هذا العام الذين حققوا على الأقل في الدورة الأولى ( 2249 من 2400) أو في الدورة الثانية ( 2273 من 2400) بعـد طي درجة التربية الدينية وإحـدى اللغتين الأجنبيتين.\r\n- يمكن أن يتقدم إلى مفاضلة المعهد العالي لهذا العام الطلاب المنتمين إلى (15% ) الأوائل على القطر في الثانوية العامة –الفرع العلمي للعام الدراسي السابق و الذين حققوا على الأقل في الدورة الأولى (2214 من 2400 ) أو في الدورة الثانية ( 2264 من 2400) بعد طي درجة التربية الدينية وإحـدى اللغتين الأجنبيتين.\r\n- يستثنى من شرط الـ 15% طلاب الاولمبياد العلمي السوري الحائزين على الجوائز العالمية المحددة في المرسوم التشريعي رقم /4/ تاريخ 18/1/2016.\r\nيتم قبول الطلاب الأوائل وفق النتيجة بما يتوافق مع الطاقة الاستيعابية للمعهد العالي والتي يحددها مجلس إدارة المركز.\r\nثانياً : حملة شهادة الثانوية الخاصة بالمركز الوطني للمتميزين\r\n- يخضع المتقدمون من جميع الفئات من دورتي العامين الحالي والسابق إلى اختبارات كتابية في بعض المواد التي يحددها النظام الأساسي للمعهد ( كالرياضيات والفيزياء .....) من منهاج الثانوية العلمية، و يرتب الطلاب وفق مفاضلة خاصة تدخل فيها علامة الثانوية العامة مضافاً إليها علاماتهم في الاختبارات المجراة في المعهد العالي.\r\n· يتم قبول الطلاب وفق المفاضلة بما يتوافق مع الطاقة الاستيعابية للمعهد العالي والتي يحددها مجلس إدارة المركز.','2021-09-02 06:58:52','2021-09-02 06:58:52');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (176,'10023','10019','متى يُعلن المجموع الأدنى المطلوب للتقدم إلى مفاضلة المعهد العالي الخاصة؟',0,0,0,'فور صدور نتائج امتحانات الدورة الثانية للشهادة الثانوية، إذ تحسب وزارة التربية عندها المجموع الأدنى الموافق لكون الطالب من شريحة الـ 15% الأوائل على القطر في الفرع العلمي من 2400.','2021-09-02 06:59:06','2021-09-02 06:59:06');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (177,'10024','10019','هل يتوجب على الطالب التسجيل في المفاضلة العامة للتعليم العالي مع تقدمه إلى مفاضلة المعهد العالي؟',0,0,0,'نعم بالتأكيد، وهذا إجباري لكي لا تضيع على الطالب فرصة القبول في الجامعات في حال عدم قبوله لدينا أو في حال تغيير رأيه في آخر لحظة أو انسحابه بعد بدء الدراسة لدينا أو رسوبه في نهاية العام الأول ورغبته في الالتحاق بالجامعة. التسجيل في المفاضلة العامة مسؤولية الطالب والمعهد العالي ليس مسؤولاً عن النتائج في حال تهاون الطالب في ذلك. نذكر بأن مفاضلة المعهد مستقلة عن المفاضلة العامة للجامعات السورية.','2021-09-02 06:59:20','2021-09-02 06:59:20');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (178,'10025','10019','المزيد',0,0,0,'','2021-09-02 06:59:29','2021-09-02 06:59:29');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (179,'10026','10025','كيف يجري التقدم إلى مفاضلة المعهد العالي وهل المعهد ضمن قائمة الخيارات في المفاضلة العامة للتعليم العالي؟',0,0,0,'لمعهد العالي مفاضلة داخلية خاصة ولا يندرج ضمن قائمة الكليات الهندسية كرغبة في ورقة المفاضلة العامة. لذلك يتقدم الراغبون من حملة الشهادة الثانوية من الفرع العلمي حصراً إلى مفاضلة المعهد على التوازي مع تقدمهم بشكل طبيعي إلى المفاضلة العامة.','2021-09-02 06:59:45','2021-09-02 06:59:45');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (180,'10027','10025','ما أن الاختصاص في المعهد العالي يبدأ من السنة الثالثة، فهل يضمن الطالب الحصول على الاختصاص الذي يرغب فيه؟',0,0,0,'يطلب، عند التسجيل في مفاضلة المعهد العالي، من طلاب الدراسة الخاصة وطلاب الدراسة لصالح المركز، تحديد تسلسل رغباتهم في الاختصاصات المتاحة في المعهد العالي، وعند صدور نتائج المفاضلة، بعد فحص القبول، يتم تحديد الاختصاص لكل طالب بحسب ترتيبه في نتيجة مفاضلة المعهد وبما يتوافق مع تسلسل رغباته في الاختصاص والقدرة الاستيعابية لكل اختصاص.','2021-09-02 06:59:58','2021-09-02 06:59:58');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (181,'10028','10025','ماذا يعني طالب موفد وما هي التزاماته؟',0,0,0,'الطالب الموفد هو طالب متعاقد مع جهة تمول دراسته كوزارة التعليم العالي أو مركز الدراسات والبحوث العلمية وغيرهما، وذلك مقابل التزام بالخدمة كمهندس بعد التخرج في هذه الجهة. تحدد كل جهة موفدة الراتب والميزات الأخرى الممنوحة لطلابها وكذلك طبيعة الالتزامات بعد التخرج. يتقاضى الطلاب الموفدون لصالح مركز الدراسات والبحوث العلمية مثلاً راتباً طيلة فترة دراستهم بنجاح في المعهد العالي ويُقدر بـ /102410/ ل.س خلال السنة الأولى و /103325/ ل.س خلال باقي السنوات مقابل التزام بالخدمة في المركز كمهندسين بعد التخرج لمدة تساوي مثليّ مدة الدراسة بما فيها سنوات الرسوب. يستمر الراتب طيلة أشهر السنة أي حتى في فترة العطل الصيفية. يتأخر بدء صرفه بعد بدء الدوام في السنة الأولى لشهر أو شهرين ريثما تأخذ الإجراءات الرسمية وقتها الكافي.','2021-09-02 07:00:19','2021-09-02 07:00:19');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (182,'10029','10025','ماذا يعني طالب دراسة خاصة وما التزاماته؟',0,0,0,'طالب الدراسة الخاصة هو طالب غير موفد لا يتقاضى راتباً وإنما يدرس على حسابه الشخصي، أي يدفع رسوم دراسة سنوية تحدد عند بداية العام الدراسي، حيث تسدد الأقساط والرسوم عن السنة الدراسية دفعة واحدة وخلال أسبوع من تاريخ صدور لوائح القبول في المفاضلة، وإلا يعتبر قبوله لاغياً. في المقابل لا التزامات تجاه أية جهة على طالب الدراسة الخاصة بعد التخرج، كما أن المعهد العالي غير ملزم بتوظيفه، مع إمكانية حصول ذلك إن رغب الخريج واقتضت الحاجة، شأنه شأن أي مهندس يتقدم بطلب توظيف إلى المعهد العالي. لا يتضمن قسط الدراسة تكاليف السكن والطعام الموضحة في الإجابات اللاحقة أدناه.','2021-09-02 07:00:33','2021-09-02 07:00:33');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (183,'10030','10025','ماذا يعني طالب موفد لصالح وزارة التعليم العالي (الطلاب المتميزين حصراً) ؟',0,0,0,'يخضع لقانون البعثات العلمية - من حيث الالتزام والاستحقاقات المالية ، ملتزم بخدمة الجهة الموفدة وفق القوانين النافذة لديها','2021-09-02 07:00:44','2021-09-02 07:00:44');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (184,'10031','10025','المزيد',0,0,0,'','2021-09-02 07:00:52','2021-09-02 07:00:52');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (185,'10032','10031','ماذا يعني طالب دراسة خاصة أبناء عاملين (خ أ ع)؟',0,0,0,'دراسة خاصة من أبناء العاملين في المركز والمعهد (لا يوجد جهة إيفاد) ويحدد مجلس الإدارة /4/ مقاعد فقط ويدفع الطالب (50%) من قيمة القسط السنوي ورسوم الدراسة الخاصة المذكورة أعلاه. وهو طالب غير ملتزم بالخدمة في المركز.','2021-09-02 07:01:10','2021-09-02 07:01:10');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (186,'10033','10031','ما هي مدة الدراسة في المعهد العالي؟',0,0,0,'هي خمس سنوات وتقسم إلى مرحلتين:\r\n1 – جذع مشترك: ومدته سـنتان.\r\n2 – اختـصاص: ومدته ثلاث سنوات. يحصل الطالب في نهاية الدراسة عـلى شهادة الإجازة في الهندسة في أحد الاختصاصات المذكورة أعلاه، ويمكن للطالب الموفد أن يتابع دراسته العليا في الماجستير والدكتوراه في المعهد العالي، مع إمكانية الإيفاد خارج القطر للطلاب المتفوقين الموفدين لصالح مركز الدراسات والبحوث العلمية بعد التخرج بحسب حاجات المركز.','2021-09-02 07:01:19','2021-09-02 07:01:19');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (187,'10034','10031','ما هي الأوراق الأولية المطلوبة للتسجيل في المفاضلة؟',0,0,0,'1. صورة مصدقة عن وثيقة النجاح في الثانوية العامة – الفرع العلمي\r\n2. صورة عن الهوية الشخصية .\r\n3. صورة شخصية ملونة.\r\n4.طابع البحث العلمي بقيمة 25 ل.س عدد / 1 / ( متوفر داخل المعهد).','2021-09-02 07:01:33','2021-09-02 07:01:33');
INSERT INTO `telegram_commands` (`id`,`command_id`,`parent_id`,`name`,`is_leaf`,`take_params`,`is_parameter`,`description`,`created_at`,`updated_at`) VALUES (188,'10035','10031','ما هي الأوراق الثبوتية المطلوبة للتسجيل النهائي بعد إعلان المفاضلة ؟ تثبيت التسجيل ؟',0,0,0,'1. الوثيقة الأصلية للثانوية العامة / الفرع العلمي / دورة العام نفسه مع / 4 / صور مصدقة عنها.\r\n2. إخراج قيد نفوس ( من دوائر الأحوال المدنية ) عدد / 2 /.\r\n3. صورة عن الهوية الشخصية عدد / 4 /.\r\n4. وثيقة سجل عدلي ( غير محكوم ).\r\n5. وثيقة تبرع بالدم أو إعفاء ( تُرفق مع الشهادة الصحية ).\r\n6. شهادة صحية – من لجنة فحص العاملين في الدولة – ( يجري الحصول عليها بموجب إحالة من المعهد العالي).\r\n7. صك تعهد ( يؤخذ من المعهد العالي ) للطلاب الموفدين ببعثة دراسية داخلية لصالح مركز الدراسات والبحوث العلمية يوثق من الكاتب بالعدل حصراً ، وفي حال عدم بلوغ الطالب سن / 18 / عاماً يُصدق أيضاً من القاضي الشرعي بحضور ولي أمر الطالب.\r\n8. صور شخصية ملونة عدد / 18 / ، يُكتب الاسم الثلاثي خلفها حتماً.\r\n9. طابع البحث العلمي بقيمة / 25 / ل .س عدد / 1 / ( متوفر داخل المعهد).\r\n10. طابع المجهود الحربي بقيمة / 50 / ل.س عدد / 1 / ( متوفر داخل المعهد ).','2021-09-02 07:01:49','2021-09-02 07:01:49');
